import React from 'react';
import Layout from '../components/Layout';
import CardsContainer from '../components/CardsContainer';

const index = () => {
  return (
    <>
      <Layout title="Home" >
        <CardsContainer />
      </Layout>

      <style jsx global>
        {`
          * {
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </>
  );
};

export default index;
